import React from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
// import './index.css';
import { Menu, Icon } from 'antd';

const { SubMenu } = Menu;

function SubMenuItem(props) {
    console.log(props.data.id)
    if (props.data.children) {
        return <SubMenu key={"sub"+props.data.id} title={props.name}>
            <SubMenuItem data={props.data.children}/>
        </SubMenu>
    }else{
        return <Menu.Item key={props.data.id}>{props.name}</Menu.Item>
    }
}
export default  class Sider extends React.Component {
    // submenu keys of first level
    rootSubmenuKeys = ['sub13', 'sub14'];

    state = {
        openKeys: ['sub13'],
    };

    onOpenChange = openKeys => {
        const latestOpenKey = openKeys.find(key => this.state.openKeys.indexOf(key) === -1);
        // if (this.rootSubmenuKeys.indexOf(latestOpenKey) === -1) {
        //     this.setState({ openKeys });
        // } else {
            this.setState({
                openKeys: latestOpenKey ? [latestOpenKey] : [],
            });
        // }
    };
    render() {
        // if (this.props.data.length > 0) {
        //     return <Menu
        //         mode="inline"
        //         openKeys={this.state.openKeys}
        //         onOpenChange={this.onOpenChange}
        //         style={{ width: 256 }}
        //     >
        //         {this.props.data.map((value, index) => {
        //             return <SubMenuItem data = {value} />
        //         })}
        //
        //     </Menu>
        //
        //
        // } else {
        //     return <div></div>
        // }
        return(
            <Menu
                mode="inline"
                openKeys={this.state.openKeys}
                onOpenChange={this.onOpenChange}
                style={{ width: 256 }}
            >
                <SubMenu
                    key="sub2"
                    title={
                        <span>
                            <Icon type="appstore" />
                            <span>Navigation Two</span>
                        </span>
                    }
                >
                    <Menu.Item key="5">Option 5</Menu.Item>
                    <Menu.Item key="6">Option 6</Menu.Item>
                    <SubMenu key="sub3" title="Submenu">
                        <Menu.Item key="7">Option 7</Menu.Item>
                        <Menu.Item key="8">Option 8</Menu.Item>
                    </SubMenu>
                </SubMenu>

            </Menu>
        )
    }
}
